import React from "react";
import { GCU_COLOR, PURPLE_GRADIENT, spacing } from "./theme";
import ContactMailIcon from "@mui/icons-material/ContactMail";
import HomeOutlinedIcon from "@mui/icons-material/HomeOutlined";
import RoomOutlinedIcon from "@mui/icons-material/RoomOutlined";
import HourglassEmptyOutlinedIcon from "@mui/icons-material/HourglassEmptyOutlined";
import MenuIcon from "@mui/icons-material/Menu";

const style = {
  width: "32px",
  height: "32px",
};

const BOTTOM_ACTIONS = [
  {
    label: "Home",
    icon: <HomeOutlinedIcon style={style} />,
  },
  {
    label: "Student ID",
    icon: <ContactMailIcon style={style} />,
  },
  {
    label: "Map",
    icon: <RoomOutlinedIcon style={style} />,
  },
  {
    label: "Hours",
    icon: <HourglassEmptyOutlinedIcon style={style} />,
  },
  {
    label: "More",
    icon: <MenuIcon style={style} />,
  },
];

export const BottomBarAction = ({
  icon,
  label,
}: {
  icon: React.ReactNode;
  label: string;
}) => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        padding: spacing(1),
        fontSize: "1em",
      }}
    >
      {icon}
      <div style={{ fontSize: "0.8rem", overflow: "hidden" }}> {label}</div>
    </div>
  );
};

export const GCUBottomBar = () => {
  return (
    <div
      style={{
        position: "fixed",
        top: "auto",
        bottom: 0,
        left: 0,
        width: "100vw",
        height: "56px",
        color: "rgba(0, 0, 0, 0.3)",
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        backgroundColor: GCU_COLOR.white,
      }}
    >
      {BOTTOM_ACTIONS.map((action) => (
        <BottomBarAction key={action.label} {...action} />
      ))}
    </div>
  );
};
